Description: Update multiple tasks for the same parent in one request.${OFF}${BLUE}(AUTH - BASIC)${OFF}${BLUE}(AUTH - HEADER)${OFF}" | paste -sd' ' | fold -sw 80 | sed '2,$s/^/    /'
